import React from "react";
import { stores } from "./vibes";

export default class SideBar extends React.PureComponent {
  render() {
    const { features } = stores;
    return (
      <div class="sidebar2">
        <div class="heading">
          <h1>The Vibes</h1>
        </div>
        <div id="listings" class="listings">
          {features.map((place) => {
            return <div>{place.text}</div>;
          })}
        </div>
      </div>
    );
  }
}
